import React, { useMemo, useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import './Projects.css';

const Projects = ({ theme }) => {
  const [isFannedOut, setIsFannedOut] = useState(false);
  const [hoveredCard, setHoveredCard] = useState(null);

  const projects = useMemo(() => [
    {
      id: 1,
      title: "E-Commerce Platform",
      description: "Full-stack e-commerce solution with React, Node.js, and MongoDB",
      tech: ["React", "Node.js", "MongoDB", "Stripe"],
      image: "/project1.jpg",
      link: "#"
    },
    {
      id: 2,
      title: "Task Management App",
      description: "Collaborative task management with real-time updates",
      tech: ["Vue.js", "Express", "Socket.io", "PostgreSQL"],
      image: "/project2.jpg",
      link: "#"
    },
    {
      id: 3,
      title: "Weather Dashboard",
      description: "Real-time weather data visualization with interactive maps",
      tech: ["React", "D3.js", "OpenWeather API", "CSS3"],
      image: "/project3.jpg",
      link: "#"
    },
    {
      id: 4,
      title: "Social Media Analytics",
      description: "Analytics dashboard for social media performance tracking",
      tech: ["Next.js", "Python", "Chart.js", "Redis"],
      image: "/project4.jpg",
      link: "#"
    },
    {
      id: 5,
      title: "Portfolio Website",
      description: "Responsive portfolio with modern animations and dark mode",
      tech: ["React", "Framer Motion", "CSS3", "Vite"],
      image: "/project5.jpg",
      link: "#"
    }
  ], []);

  const handleDeckClick = () => {
    setIsFannedOut(!isFannedOut);
  };

  const handleCardClick = (projectId) => {
    // Handle individual card click - could open modal or navigate
    console.log('Opening project:', projectId);
  };

  const sectionStyles = useMemo(() => ({
    '--projects-bg': theme === 'dark' ? 'linear-gradient(135deg, #042a1c 0%, #042a1c 100%)' : 'linear-gradient(135deg, #EEEEEE 0%, #EEEEEE 100%)',
    '--projects-title-color': theme === 'dark' ? '#e3e5e6' : '#000000',
    '--text-shadow-1': theme === 'dark' ? '#0d4f3c' : '#374151',
    '--text-shadow-2': theme === 'dark' ? '#1a5f4a' : '#4b5563',
    '--text-shadow-3': theme === 'dark' ? '#2d6b58' : '#6b7280',
    '--text-shadow-4': theme === 'dark' ? '#407766' : '#9ca3af',
    '--card-bg': theme === 'dark' ? 'rgba(227, 229, 230, 0.05)' : 'rgba(255, 255, 255, 0.8)',
    '--card-border': theme === 'dark' ? 'rgba(227, 229, 230, 0.2)' : 'rgba(0, 0, 0, 0.1)',
    '--card-shadow': theme === 'dark' ? '0 8px 32px rgba(0, 0, 0, 0.3)' : '0 8px 32px rgba(0, 0, 0, 0.1)',
    '--glow-gradient': theme === 'dark' ? 'linear-gradient(45deg, #ff00ff, #00ffff)' : 'linear-gradient(45deg, #3b82f6, #06b6d4)'
  }), [theme]);

  return (
    <section 
      id="projects" 
      className="projects-section"
      style={sectionStyles}
    >
      <div className="projects-container">
        <div className="projects-content">
          <div className="projects-header">
            <h2 className="projects-title">
              Projects
            </h2>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Projects;
